import React from "react";
import {RaffleTimer} from "./RaffleTimer";

export const Banner = ({data}) => {
  return (
    <div className={'banner-bg banner'}>
      <div className={"col-md-12 d-flex m-flex"}
           style={{
             backgroundImage: `url(${require('../../../assets/—Pngtree.png')})`,
             backgroundPosition: 'center',
             backgroundSize: 'cover',
             backgroundRepeat: 'no-repeat',
             minHeight: '543px',
             borderRadius: '30px'
           }}
      >
        {/*{data.map((data, index) =>*/}

        <div className={'col-md-6 d-flex flex-column justify-content-center p-5 m-text-align-center'}>
          <div className={'bigTitle white-color m-fs-24'}>
            Pixel 4 modern edition
          </div>
          <div className={"paragraph off-white-color m-mt-1"}>
            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the
            industry's standard dummy text ever since the 1500s
          </div>
          <div className={'col-md-6'}>
            <RaffleTimer timer={'1 hr : 30 mins : 27 sec'}/>
          </div>
          <div className={'d-flex m-justify-content-center'}>
            <div className={'secondary-bg-color secondary-btn white-color paragraph-bold mt-5'}> Add to watchlist
            </div>
          </div>
        </div>

        <div className={'col-md-6'}>
          <img className={'fullwidth'}
               src={"https://lh3.googleusercontent.com/proxy/GXvIXtHh0YkAZPA7WYVaDngtqdf_nC3-cPGfn_ycczmCuD-2wo87gq6odCeZV1_OKh5EUBIJgjwXyPO1uK8N4ggb9IZjXUAeyS2NrIzgRsv_YNaajSfA7KiIL9iSuS22VFI3sbeEOTA1kS-UoGAsOUCt"}
               alt={"post-images"}/>
        </div>
      </div>
    </div>
  )
};
